import React, {Component} from 'react';
import BoxHeaderButton from './BoxHeaderButton';
import databreakfast from '../../data/databreakfast.json'


class Breakfast extends Component {
  constructor(){
    super();
    this.state={
      databreakfast,
    }
  }
  render() {
    const desayuno= this.state.menu.desayuno.map((menu)=>{
      return (
        <BoxHeaderButton title={menu.name + " " + menu.valor} customOnButtonClick={() => { this.props.nameProduct(menu)}}/>
      )
    })
        return ( 
          <div>
            <Row>
             <Col xs={4}>
          {desayuno}
            </Col>
            </Row>
            </div>

        );
      }
    }
    const mapStateToProps = (state)=>{
      return {
        ...state
      };
    };

    const mapDispatchToProps = (dispatch) => {
      return {
        nameProduct: addToOrder(dispatch),
      }
    }
    export default connect(
      mapStateToProps,
      mapDispatchToProps
      )(TemplateMenuDesayuno);
